import React from 'react';
import data from '../data';
import CategoryInfo from './CategoryInfo';


export default function CategoryDetail(match) {
    const { types } = data;
    console.log({ types })
    console.log({match})
    function test({match}){
        if(match.params.type_name === types[1].type_name){
            console.log("true")
        }
        console.log("false")
    }
    console.log(test())
    return (
        <div>
            <CategoryInfo types={types} />
        </div>
    )
}
